// ];
import React from 'react';

const Config = () => {
  const [data, setData] = React.useState([]);
  const fs = require('fs');
  fs.readFile('./data/dataDate.json', 'utf-8', (err, dataJson) => {
    if (err) console.log(err);
    setData(JSON.parse(dataJson));
  });
  console.log(data);
  return <div></div>;
};

export default Config;
// console.log('data: ', data);
